function MessageBoxShow(Title,Text,Type,CType) {
    var imageurl = ImageSelect(Type);
    var classname= ClassSelect(CType);
    $.gritter.add({
        title: Title,
        text: Text,
        image: imageurl,
        sticky: false,
        class_name: classname,
        time: ''
    });
}
function  ImageSelect(Type) {
    switch(Type) {

        case "0":
            return 'data:image/png;base64,';
            break;
        case "1":
            return 'data:image/png;base64,';
            break;
        case "2":
            return 'data:image/png;base64,';
            break;
        case "3":
            return 'data:image/png;base64,';
            break;
        default:
            return 'data:image/png;base64,';
            break;
    }
}

function ClassSelect(Kod){
    switch(Kod) {
        case "0":
            return "growl-info";
            break;
        case "1":
            return "growl-success";
            break;
        case "2":
            return "growl-warning";
            break;
        case "3":
            return "growl-danger";
            break;
        default:
            return "growl-primary";
            break;
    }
}